# Load the data# When data is without antenna position (no machine)# <timestamp> <level> <bytes rx> <bitrate rx (B/s)>clear all;close all;inputData = load("../data/data10m.txt");# Remove all entrys whose bitrate is less than 1000position = 1;for i = 1:rows(inputData)  if ((inputData(i, 4) >= 1000))    filteredData(position, :) = inputData(i, :);    position += 1;  endifendfor#figure(1);#hold on;x = 1:rows(filteredData);level = filteredData(:, 2);bitrate = filteredData(:, 4);bitrateMbps = bitrate / 1e6;